/* **************** 
*   Styles       * 
******************/

export const Pointer = {
    cursor: 'pointer'
}

export const TabStyle = {
    width: '95%',
    marginLeft: 'auto',
    marginRight: 'auto',
    marginTop: '20px',
    marginBottom: '20px'
}

export const HomeCardStyle = {
    Card: {
        width: '300px',
        height: '400px',
        marginRight: '50px',
        marginLeft: '50px',
        textAlign: 'center'
    },
    Title: {
        marginTop: '10px',
    }
}

export const ImageStyles = {
    HomeCard: {
        maxWidth: '150px',
        maxHeight: '150px',
        marginRight: 'auto',
        marginLeft: 'auto'
    },
    HomeAvatar: {
        borderRadius: '50%',
        width: '20%',
        height: 'auto'
    },
    About: {
        width: '300px',
        height: '300px',
        padding: '5px'
    }
}

export const TvpageStyle = {
    Image: {
        display: 'flex',
        height: '300px',
        width: '200px',
        marginLeft: 'auto',
        marginRight: 'auto',
        marginTop: '10px',
        marginBottom: '10px'
    },
    Title: {
        height: '20px',
        width: '200px',
        margin: 4,
        wordWwrap: 'break-word',
    },
    Cast: {
        maxHeight: '20px',
        width: '200px',
        margin: 4,
        wordWwrap: 'break-word',
        maxFontSize: '1vw'
    },
    Layout: {
        margin: 20,
        padding: 20,
        border: '1px solid #DDD',
        backgroundColor: 'white'
    },
    Link: {
        marginRight: 15,
        fontSize: 20
    }
}

export const DandDStyle = {
    thumbnail: {
        position: 'relative',
        align: 'center'
    },
    Avatar: {
        height: '300px',
        width: 'auto',
    }
}

//used in provider compliance drivers and
//vehicles lists
export const Tplist = {
    Title: {
        textAlign: 'center',
        marginTop: '10px'
    },
    Value: {
        paddingTop: '10px'
    },
    Info: {
        marginLeft: '25px',
        marginTop: '0px',
        marginBottom: '0px'
    }
}
